import React, { useState, useEffect }  from 'react';
import './AboutUs.css'; // Optional for additional styles
// import '../../assets/mountain.jpg'

const CounterSection = () => {
  const [recommendPercent, setRecommendPercent] = useState(0);
  const [happyCustomers, setHappyCustomers] = useState(0);
}


  useEffect(() => {
    const percentInterval = setInterval(() => {
      setRecommendPercent((prev) => {
        if (prev < 90) return prev + 1;
        clearInterval(percentInterval);
        return prev;
      });
    }, 30); // Speed of counter animation

    const customersInterval = setInterval(() => {
      setHappyCustomers((prev) => {
        if (prev < 1000) return prev + 10;
        clearInterval(customersInterval);
        return prev;
      });
    }, 10); // Speed of counter animation

    return () => {
      // clearInterval(percentInterval);
      // clearInterval(customersInterval);
    };
  }, []);

const AboutUs = () => {
  return (
    <>
    <section className="py-5">
      <div className="container">
        {/* Company Introduction */}
        <div className="row align-items-center mb-5">
          <div className="col-lg-6 mb-4 mb-lg-0">
            <img
              src="" alt="About our company" 
              // className="img-fluid rounded"
            />
          </div>
          <div className="col-lg-6">
            <h1 class="heading1">About</h1>
            <h2 class="heading2">Adventure tales</h2>
            <h3 class="heading3">World</h3>

            <p class={"para1"}>
              Welcome to Adventure Tales World, your trusted travel partner in Georgia and beyond. 
              We specialize in curating unforgettable tours, car rentals, living arrangements, and more. 
              Our mission is to offer you an unmatched experience, full of exciting adventures and new stories.
            </p>
          </div>
        </div>

        {/* Motivated Company Section */}
        <div className="row align-items-center mb-5">
          <div className="col-lg-6 order-lg-2 mb-4 mb-lg-0">
            <img
              src="https://example.com/motivation-image.jpg"
              alt="Motivated team"
              className="img-fluid rounded"
            />
          </div>
          <div className="col-lg-6 order-lg-1" >
            <h1 class="head1">Driven</h1>
            <h2 class="head2">By</h2> 
            <h3 class="head3">Passion</h3>
            <p class="para1">
              At Adventure Tales World, we are a motivated team of travel enthusiasts dedicated to providing 
              exceptional service. We believe that travel can change lives, and we are committed to crafting 
              unique, personalized experiences that go beyond the ordinary.
            </p>
          </div>
        </div>

        {/* Featured Section */}
        <div className="row align-items-center">
          <div className="col-lg-6 mb-4 mb-lg-0">
            <img
              src=""
              alt="Feature-rich services"
              className="img-fluid rounded"
            />
          </div>
          <div className="col-lg-6">
            <h1 class="hed1">Feature</h1>
            <h2 class="hed2">-Rich</h2>
            <h3 class="hed3">Services</h3>
            <p class="para1">
              Our services include everything from guided tours to car rentals, accommodations, and currency exchange. 
              We handle all aspects of your trip, ensuring a seamless experience from the moment you land in Georgia 
              or Dubai. Let us take care of the details so you can focus on the adventure!
            </p>
          </div>
        </div>
      </div>
    </section>
 <section id="counters" className="py-5 text-center">
 <div className="container">
   <div className="row">
     {/* First Counter */}
     <div className="col-lg-6 mb-4 mb-lg-0">
       <div className="counter-box">
         <h2 className="counter">{recommendPercent}%</h2>
         <p className="counter-heading">Percent of travelers recommend us to friends and family</p>
       </div>
     </div>

     {/* Second Counter */}
     <div className="col-lg-6">
       <div className="counter-box">
         <h2 className="counter">{happyCustomers}</h2>
         <p className="counter-heading">Happy Customers</p>
       </div>
     </div>
   </div>
 </div>
</section>
    </>
  );
};

export default AboutUs;
